import React from 'react';
import './App.css';

// Main Page -- What is displayed across all pages
function App() {
    return (
        <div className="h-screen bg-gray-100 flex flex-col items-center justify-center text-center">
            {/* Title */}
            <h1 className="text-6xl font-bold text-gray-800 mb-4">
                <span className="text-blue-500">D</span>
                <span className="text-green-500">A</span>
                <span className="text-purple-500">V</span>
                <span className="text-red-500">E</span>
            </h1>

            {/* Subtitle */}
            <p className="text-xl md:text-2xl font-medium text-gray-700">
                <span className="text-blue-500 font-semibold">D</span>ynamic
                <span className="text-green-500 font-semibold"> A</span>lgorithm
                <span className="text-purple-500 font-semibold"> V</span>isualiz
                <span className="text-red-500 font-semibold"> E</span>r
            </p>
        </div>
    );
}

export default App;
